import React from "react";
import { Card, CardBody, Row } from "reactstrap";
import AppLayout from "../../layout";

const index = () => {
  return (
    <AppLayout>
      <Row>
        <Col>
          <Card>
            <CardBody>
              <h3>Employees</h3>
              <p>1024</p>
            </CardBody>
          </Card>
        </Col>
      </Row>
    </AppLayout>
  );
};

export default index;
